import React from "react";
import DonorOrNGO from "./components/DonorOrNGO";
import { Switch, Route, Redirect } from "react-router-dom";
import SignUpAsDonor from "./components/Auth/SignUpAsDonor";
import SignUpAsNGO from "./components/Auth/SignUpAsNGO";
import LogInAsDonor from "./components/Auth/LogInAsDonor";
import LogInAsNGO from "./components/Auth/LogInAsNGO";
import NewCampaign from "./components/createCampaign/NewCampaign";
import Heading from "./components/Heading";
import Navbar from "./components/Navbar";
import GetCampaign from "./components/createCampaign/GetCampaign";
function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <Navbar />
          <Redirect to="/landingPage" />
        </Route>
        <Route path="/landingPage">
          <Navbar />
          <DonorOrNGO />
        </Route>
        <Route path="/suD">
          <Navbar />
          <SignUpAsDonor />
        </Route>
        <Route path="/suN">
          <Navbar />
          <SignUpAsNGO />
        </Route>
        <Route path="/liD">
          <Navbar />
          <LogInAsDonor />
        </Route>
        <Route path="/liN">
          <Navbar />
          <LogInAsNGO />
        </Route>
        <Route path="/cmcF">
          <Navbar />
          <NewCampaign />
        </Route>
        <Route path="/homePage">
          <Navbar />
          <Heading />
        </Route>
        <Route path="/yourCampaign">
          <GetCampaign />
        </Route>
      </Switch>
    </div>
  );
}
export default App;
